PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
ASK WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/conf/recomb/SongL06>
  }
  {
    ?pub dblp:yearOfPublication ?y .
    FILTER ( ?y = "2007" ^^ xsd:gYear )
  } UNION {
    ?pub dblp:yearOfEvent ?y2 .
    FILTER ( ?y2 = "2007" ^^ xsd:gYear )
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?count2016 ) WHERE {
  VALUES ?author {
    <https://dblp.org/pid/q/MeikangQiu> <https://dblp.org/pid/164/3309> <https://dblp.org/pid/184/6425>
  }
  ?pub dblp:authoredBy ?author .
  OPTIONAL {
    ?pub dblp:yearOfPublication ?y .
  }
  OPTIONAL {
    ?pub dblp:yearOfEvent ?e .
  }
  FILTER ( ( BOUND( ?y ) && STR( ?y ) = "2016" ) || ( BOUND( ?e ) && STR( ?e ) = "2016" ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX owl: <http://www.w3.org/2002/07/owl#>
SELECT DISTINCT ?creator ?wikidata WHERE {
  ?creator a dblp:Creator ; rdfs:label "A. Jefferson Offutt" .
  {
    ?creator dblp:wikidata ?wikidata .
  } UNION {
    ?creator owl:sameAs ?wikidata .
  }
}
LIMIT 10

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?stream ?streamLabel WHERE {
  <https://dblp.org/rec/journals/jlp/ShieberSP95> dblp:publishedInStream ?stream .
  OPTIONAL {
    ?stream rdfs:label ?streamLabel
  }
}
LIMIT 10

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?author ?authorLabel ?stream ?streamLabel WHERE {
  BIND( <https://dblp.org/rec/conf/fgcn/ChenZXSS08> AS ?targetPub ) ?targetPub dblp:authoredBy ?author .
  ?otherPub dblp:authoredBy ?author .
  FILTER ( ?otherPub != ?targetPub ) {
    ?otherPub dblp:publishedInStream ?stream .
  } UNION {
    ?otherPub dblp:publishedInJournal ?stream .
  }
  OPTIONAL {
    ?author rdfs:label ?authorLabel
  }
  OPTIONAL {
    ?stream rdfs:label ?streamLabel
  }
}
LIMIT 1000

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?title ?label WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/63/10539> .
  OPTIONAL {
    ?pub dblp:title ?title
  }
  OPTIONAL {
    ?pub rdfs:label ?label
  }
}
ORDER BY ?title ?label

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?title ?stream ?streamLabel ?yearPub ?yearEvent WHERE {
  ?pub dblp:authoredBy <https://dblp.org/pid/64/490> ; dblp:title ?title .
  OPTIONAL {
    ?pub dblp:publishedInStream ?stream .
    ?stream rdfs:label ?streamLabel
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?yearPub
  }
  OPTIONAL {
    ?pub dblp:yearOfEvent ?yearEvent
  }
  FILTER ( ?stream IN ( <https://dblp.org/streams/conf/vtc> , <https://dblp.org/streams/journals/corr> ) )
}
ORDER BY ?yearPub ?title

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( COUNT( DISTINCT ?pub ) AS ?count ) WHERE {
  ?pub ( dblp:authoredBy | dblp:createdBy ) <https://dblp.org/pid/21/4802> .
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pub ( COUNT( DISTINCT ?author ) AS ?numAuthors ) ( SAMPLE( ?label ) AS ?labelSample ) WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/tcyb/MaB21> <https://dblp.org/rec/conf/etfa/Missal0H07>
  }
  ?pub dblp:authoredBy ?author .
  OPTIONAL {
    ?pub rdfs:label ?label
  }
}
GROUP BY ?pub
ORDER BY DESC ( ?numAuthors )

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?co ( SAMPLE( ?lbl ) AS ?coLabel ) ( GROUP_CONCAT( DISTINCT ?aff ; SEPARATOR = "; " ) AS ?affiliations ) ( COUNT( DISTINCT ?pub ) AS ?numPubs ) WHERE {
  BIND( <https://dblp.org/pid/286/6829> AS ?author ) ?pub dblp:authoredBy ?author ; dblp:authoredBy ?co .
  FILTER ( ?co != ?author ) OPTIONAL {
    ?pub dblp:yearOfPublication ?yPub .
  }
  OPTIONAL {
    ?pub dblp:yearOfEvent ?yEvt .
  }
  FILTER ( ( BOUND( ?yPub ) && xsd:integer ( STR( ?yPub ) ) >= 2023 ) || ( BOUND( ?yEvt ) && xsd:integer ( STR( ?yEvt ) ) >= 2023 ) ) OPTIONAL {
    ?co rdfs:label ?lbl .
  }
  OPTIONAL {
    {
      ?co dblp:affiliation ?aff
    } UNION {
      ?co dblp:primaryAffiliation ?aff
    }
  }
}
GROUP BY ?co
ORDER BY DESC ( ?numPubs )

PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {
  ?pub dblp:authoredBy <https://dblp.org/pid/p/JianPei> ; dblp:publishedInStream ?stream .
  FILTER ( CONTAINS( LCASE( STR( ?stream ) ) , "conf/icdm" ) )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?pubLabel ?stream ?streamLabel ?year WHERE {
  ?pub a dblp:Publication .
  ?pub rdfs:label ?pubLabel .
  FILTER ( CONTAINS( LCASE( STR( ?pubLabel ) ) , "coverless video steganography based on inter frame combination" ) ) .
  OPTIONAL {
    ?pub dblp:publishedInStream ?stream .
    ?stream rdfs:label ?streamLabel .
  }
  OPTIONAL {
    ?pub dblp:publishedInJournal ?stream .
    ?stream rdfs:label ?streamLabel .
  }
