    ?pub dblp:yearOfPublication ?year .
  }
}
LIMIT 20

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pub ?label ?year WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/cga/Kroeker02> <https://dblp.org/rec/conf/pldi/PhuliaBB20>
  }
  OPTIONAL {
    ?pub rdfs:label ?label .
  }
  OPTIONAL {
