  }
}
ORDER BY ?year

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?author ?total ?minYear ?maxYear ?spanYears ?avgPerYear WHERE {
  VALUES ?author {
    <https://dblp.org/pid/45/1135>
  }
  {
    SELECT ?author ( COUNT( DISTINCT ?pub ) AS ?total ) ( MIN( xsd:integer ( STR( ?yearVal ) ) ) AS ?minYear ) ( MAX( xsd:integer ( STR( ?yearVal ) ) ) AS ?maxYear ) WHERE {
      VALUES ?author {
        <https://dblp.org/pid/45/1135>
      }
      ?pub dblp:authoredBy ?author .
      OPTIONAL {
        ?pub dblp:yearOfPublication ?yop .
      }
      OPTIONAL {
        ?pub dblp:yearOfEvent ?yoe .
      }
      BIND( COALESCE ( ?yop , ?yoe ) AS ?yearVal ) FILTER ( BOUND( ?yearVal ) )
    }
    GROUP BY ?author
  }
  BIND( ( ?maxYear - ?minYear + 1 ) AS ?spanYears ) BIND( xsd:decimal ( ?total ) / xsd:decimal ( ?spanYears ) AS ?avgPerYear )
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?label ?stream ?streamLabel ?year ?page WHERE {
  ?pub a dblp:Publication ; rdfs:label ?label ; dblp:yearOfPublication ?year .
  OPTIONAL {
    ?pub dblp:publishedInStream ?stream .
    OPTIONAL {
      ?stream rdfs:label ?streamLabel
    }
  }
  OPTIONAL {
    ?pub dblp:documentPage ?page
  }
  FILTER ( CONTAINS( LCASE( STR( ?label ) ) , "interplay between depth of neural networks and locality of target functions" ) )
}
LIMIT 20

