PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pub ?pubLabel ?year ( GROUP_CONCAT( DISTINCT ?authorStr ; SEPARATOR = " | " ) AS ?authors ) WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/nar/KanzAABBBBBCCDEFGDHKLLLMMNSSSTTVWZA05> <https://dblp.org/rec/journals/nar/KulikovaAABBBBCDEFGHKLLLLMMNSSSTTVWZA04> <https://dblp.org/rec/journals/nar/StoesserBBCGKKLLLLRSTTV03> <https://dblp.org/rec/journals/nar/StoesserBBCGKKLLPRSST01> <https://dblp.org/rec/journals/nar/BakerBCHSST00> <https://dblp.org/rec/journals/nar/StoesserMSMGS98> <https://dblp.org/rec/journals/nar/StoesserSTSC97> <https://dblp.org/rec/journals/nar/StoesserTLS99> <https://dblp.org/rec/journals/nar/StoesserBBGKKLLLLMNSTTV03> <https://dblp.org/rec/journals/nar/KulikovaAAAABBBBBCCDEFHKLLLLLLMMNPPSSVWZA07>
  }
  OPTIONAL {
    ?pub rdfs:label ?pubLabel
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?year
  }
  ?pub dblp:authoredBy ?author .
  OPTIONAL {
    ?author rdfs:label ?authorLabel
  }
  OPTIONAL {
    ?author dblp:affiliation ?aff
  }
  OPTIONAL {
    ?author dblp:primaryAffiliation ?primAff
  }
  BIND( COALESCE ( ?authorLabel , STR( ?author ) ) AS ?aLabel ) BIND( COALESCE ( ?aff , ?primAff ) AS ?aAff ) BIND( CONCAT ( STR( ?aLabel ) , " (" , COALESCE ( STR( ?aAff ) , "affiliation not available" ) , ")" ) AS ?authorStr )
}
GROUP BY ?pub ?pubLabel ?year
ORDER BY ?pub ?year

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?title ?label ?year ?doi WHERE {
