  FILTER ( ( bound( ?yEvent ) && ?yEvent = "2003" ^^ xsd:gYear ) || ( bound( ?yPub ) && ?yPub = "2003" ^^ xsd:gYear ) ) FILTER ( CONTAINS( LCASE( STR( ?title ) ) , "overlay" ) && CONTAINS( LCASE( STR( ?title ) ) , "multicast" ) ) FILTER ( bound( ?streamLabel ) && CONTAINS( LCASE( STR( ?streamLabel ) ) , "high performance" ) )
}
