}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?title ?year ?doi ?stream ?streamLabel ?song ?songLabel WHERE {
  BIND( <https://dblp.org/pid/50/4880> AS ?bi ) ?pub dblp:authoredBy ?bi ; dblp:authoredBy ?song ; dblp:publishedInStream ?stream .
  ?song rdfs:label ?songLabel .
  ?stream rdfs:label ?streamLabel .
  OPTIONAL {
    ?pub dblp:title ?title
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?year
  }
  OPTIONAL {
    ?pub dblp:doi ?doi
  }
  FILTER ( ?song != ?bi ) FILTER ( CONTAINS( LCASE( STR( ?songLabel ) ) , "song zheng" ) ) FILTER ( CONTAINS( LCASE( STR( ?streamLabel ) ) , "appl. math. comput" ) || CONTAINS( LCASE( STR( ?streamLabel ) ) , "applied mathematics and computation" ) || CONTAINS( LCASE( STR( ?streamLabel ) ) , "appl. math." ) )
}
ORDER BY ?year ?title

PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT ( AVG( ?coCount ) AS ?avgCoauthors ) WHERE {
