PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?pub ( COUNT( DISTINCT ?author ) AS ?numAuthors ) ( SAMPLE( ?title ) AS ?titleSample ) ( SAMPLE( ?label ) AS ?labelSample ) WHERE {
  VALUES ?pub {
    <https://dblp.org/rec/journals/dam/CheonK08> <https://dblp.org/rec/conf/humanoids/ChestnuttK04>
  }
  ?pub dblp:authoredBy ?author .
  OPTIONAL {
    ?pub dblp:title ?title
  }
  OPTIONAL {
