  }
  FILTER ( ( ( BOUND( ?yearEvent ) && STR( ?yearEvent ) = "1994" ) || ( BOUND( ?yearPub ) && STR( ?yearPub ) = "1994" ) ) && ( BOUND( ?title ) && CONTAINS( LCASE( STR( ?title ) ) , "phase" ) && CONTAINS( LCASE( STR( ?title ) ) , "recover" ) ) )
}

