PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT ?co ( SAMPLE( ?coLabel ) AS ?coLabelSample ) ( GROUP_CONCAT( DISTINCT ?aff ; separator = "; " ) AS ?affiliations ) ( COUNT( DISTINCT ?pub ) AS ?sharedPubs ) WHERE {
  BIND( <https://dblp.org/pid/79/3065> AS ?target ) .
  ?pub dblp:authoredBy ?target ; dblp:authoredBy ?co .
  FILTER ( ?co != ?target ) .
  OPTIONAL {
    ?co rdfs:label ?coLabel
  }
  .
  OPTIONAL {
    ?co dblp:affiliation ?aff
  }
  .
  OPTIONAL {
    ?pub dblp:yearOfPublication ?yPub
  }
  .
  OPTIONAL {
    ?pub dblp:yearOfEvent ?yEvent
  }
  .
  FILTER ( ( bound( ?yPub ) && ?yPub >= "2016" ^^ xsd:gYear ) || ( bound( ?yEvent ) && ?yEvent >= "2016" ^^ xsd:gYear ) )
}
GROUP BY ?co
ORDER BY DESC ( ?sharedPubs ) ?coLabelSample

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?pub ?stream ?streamLabel ?year WHERE {
  ?pub rdfs:label ?label .
  FILTER ( CONTAINS( LCASE( STR( ?label ) ) , "wireless propagation measurements for astronaut body area network" ) ) OPTIONAL {
    ?pub dblp:publishedInStream ?stream .
    OPTIONAL {
      ?stream rdfs:label ?streamLabel
    }
  }
  OPTIONAL {
    ?pub dblp:yearOfPublication ?year
  }
}
ORDER BY ?pub
LIMIT 20

